        .scaleBand()
        .domain(chartFab.map((d) => Object.keys(d)[0]))
        .range([margin.left, width - margin.right])
        .padding(0.1);

      // Thiết lập scale cho trục y
      const yScale = d3
        .scaleLinear()
        .domain([0, d3.max(chartFab, (d) => Object.values(d)[0])])
        .nice()
        .range([height - margin.bottom, margin.top]);

